@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("interbenavente.es") {
    body{
        background-color: rgb(247, 247, 247) !important;
        background-image: url("http://interbenavente.es/templates/periodico_interbenavente/images/fondo_sombra.png") !important;
        background-position: center top !important;
        background-repeat: repeat-y !important;
    }
    
    #backgroundAd, .BANNERS-TOP, .BANNERS-BOTTOM, ins, iframe[height='250'], .BANNER>object, #fpopup, a[href*='tradedoubler'], a[href*='serviciosweb'],a[href*='serviciosweb'],*[style='visibility: visible; background-image: none;'],*[alt*='facebook.com/']{
        display:none!important;
        height:0!important;
        width:0!important;
    }

    html, body, body.fpopup_showing{
        overflow: visible !important;
    }
}
